import React from 'react';
import './index.css';

const Results = ({ recommendations }) => {
    return (
        <div>
            <h2>Recommended Songs:</h2>
            <ul>
                {recommendations.map((song, index) => (
                    <li key={index}>{song.name} by {song.artist}</li>
                ))}
            </ul>
        </div>
    );
};

export default Results;
